import React from 'react'
import FooterCard from './FooterCard'
import FooterLeft from './FooterLeft'

function Footer() {
  return (
    <footer>
        <div className="footer-all">
            <FooterLeft/>
            <div className="footer-mid-cont">
                <FooterCard
                one={'Landings'}
                two={'Home'}
                theere={'Products'}
                four={"Services"}
                />
                <FooterCard
                one={'Company'}
                two={'Home'}
                theere={'Careers'}
                servicesTwo={"Services"}
                />
                <FooterCard
                company={'Company'}
                homeTwo={'Home'}
                careers={'Careers'}
                servicesTwo={"Services"}
                />
            </div>
        </div>
    </footer>
  )
}

export default Footer
